    function() external payable {
        require(balanceof[address(this)] > 0);
        uint256 receivedEther = 3000 * msg.value / 0xde0b6b3a7640000;
        if (receivedEther > 0) {
            balanceof[msg.sender] += receivedEther;
            balanceof[address(this)] -= receivedEther;
        } else if (receivedEther > balanceof[address(this)]) {
            msg.sender.transfer(msg.value - (balanceof[address(this)] * 0xde0b6b3a7640000) / 3000);
            balanceof[msg.sender] += balanceof[address(this)];
            balanceof[address(this)] = 0;
        }
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function changeOwner(address newOwner) public {
        require(msg.sender == owner);
        owner = newOwner;
    }
}
